import React, { Component } from 'react';
import './../App.css';

class Square extends Component {

    changeValue(e){
        console.log(e.target)
    }

    render() {
    return (
        <div className= {"Square" + this.props.size} key = {this.props.key} onClick = {(key) => this.changeValue(key)}>
            {this.props.value}
        </div>
    );
  }
}

export default Square;
